import React from "react";
import { Tile } from "../tile/Tile"


export const TileList = ({ appointments }) => {
  return (
    <div>
      {appointments.map((appointments, index) => {
        const {name, ...description } = appointments;
        return (
          <>
            <Tile 
              key={index}
              name={name}
              description={description} 
              />
          </>
        )
      })}

    </div>
  );
};
